import reactRouterDom from 'react-router-dom';
import './App.css';
import Recipes from './Recipes';
import Nav from './Nav';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom'

function App() {
  return (
    <Router>
    <div className="App">

      <Nav/>

      <Switch>

        <Route exact path="/">
          <Recipes/>
        </Route>

        <Route path="/asian">
          <Recipes/>
        </Route>

        <Route path="/african">
          <Recipes/>
        </Route>

        <Route path="/america">
          <Recipes/>
        </Route>

      </Switch>
    </div>
    </Router>
  )
}

export default App;
